import React from 'react';
import '../../styles/quiz-page/QuizCompletionBar.css';

const QuizCompletionBar = () => {
    return (
        <div className="QuizCompletionBar-container">
            <div className='entire-bar'>
                <div className='percent-bar'></div>
            </div>
            
        </div>
    );
};

export default QuizCompletionBar;
